import React from 'react';
import 'tachyons';
import './Card.css';

function Card(props) {
    return(
        <div className="tc bg-light-blue dib pa3 ma2 grow bw2 shadow-5">
            <img alt="robo" src={`${props.id}.jpg`}></img>
            <h2> {props.name} </h2>
            <p> {props.email} </p>
        </div>
    );
}

export default Card;
